// filepath: /Users/anubhav/Desktop/workbench/tinyslider-testing/src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import 'tiny-slider/dist/tiny-slider.css';
import { tns } from "tiny-slider/src/tiny-slider";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Initialize tiny-slider after React renders
tns({
  container: '#slider-container',
  items: 1,
  slideBy: 'page',
  autoplay: true,
  controls: true,
  nav: true,
  autoplayButtonOutput: false,
  gutter: 20 // Add some space between slides
});
